The issue seems to be with the escaped single quotes (`\'`) . If you remove them, the parsing is successful.

Version info:

- Python 3.7.7 on Mac OS X 10.15.4
- Js2Py: 0.70

Example code:

```python
js_script = """
	dataLayer = [{
		'event': 'detailview',
		'page': {
			'phase': 'interest',
		},
		'ecommerce': {
			'detail': {
				'products': [{
				'name': 'L\'eau d\'issey eau de toilette vapo men',
				'id': '1070932',
				'price': '41.69',
				'category': '',
				'brand': 'Issey',
				'quantity': 1,
				'dimension01': ''
				}]
			}
		}
	}];
"""
js_data = js2py.eval_js(js_script)

>>> JsException: SyntaxError: Line 10: Unexpected identifier
```

I have a simple *.js file, where I import some classes from PyQt Python modules:


```
import {QApplication} from 'qt';
import {QWidget} from 'qt';
import sys;

let app = new QApplication(sys.argv);
let window = new QWidget();
window.setWindowTitle("My JS To Python Qt Wrapper!!!");
window.show();
sys.exit(app.exec());
```

But I'm getting this error:
**SyntaxError: Line 1: ImportDeclaration is not supported by ECMA 5.1.**

What's wrong? Thank you.

